import "../Asserts/Css/ComponentsCss/footer.css";


const Footer=()=>{
    return(
        <div className='footer_div'>
            <div className='footer_first'></div>
            <div className='footer_second'>
                <h5>Have a Question</h5>
            </div>
        </div>

    )
}

export default Footer
